import Layout from '../components/MyLayout.js'

export default function About() {
  return (
    <Layout style={{background: "linear-gradient(#00bf8f, #001510)"}}>
      <iframe className="video" width="853" height="480"  src="https://www.youtube.com/embed/IeMw2K9Mlbg" 
      frameborder="0" allowfullscreen ng-show="showvideo"></iframe>
    <style jsx>{`
          h1,
          h2,
          h3,
          h4,
          input,
          a,
          p {
            font-family: "Arial";
            color: #006600;
          }

          h2 {
            margin: auto;
            width: 20%;
            border: 3px solid black;
            top-padding: 10px;
            text-align: center;
            color: #000000;
          }

          .button-style {
            margin: auto auto;
            cursor: pointer;
            background-color: #228b22;
            color: #000000;
            width: 100px;
            font-family: "Arial";
            text-align: center;
          }
          
          .text-style {
            margin: 20px;
          }

          input {
            margin: auto;
            width: 200px;
            text-align: center;
          }

          .description {
            font-family: "Arial";
            font-size: "10px";
          }

          ul {
            padding: 0;
          }

          li {
            list-style: none;
            margin: 5px 0;
          }

          a {
            text-decoration: none;
            color: blue;
          }

          a:hover {
            opacity: 0.6;
          }
        `}</style>
      
    </Layout>
  )
}
